import { useEffect } from 'react';
import { useDispatch } from 'react-redux';
import axios from 'axios'

import React from 'react'
import LoginComp from '../components/LoginComp'

import { doLoadUsers } from '../redux/UsersActions'
import { doLoadMovies } from '../redux/MoviesActions';

const userUrl = 'http://localhost:8000/users';
const moviesUrl = 'http://localhost:8000/movies';

const LoginPage = () => {
    const dispatch = useDispatch()

    useEffect(() => {
      const fetchUsers = async () => {
        const { data: users } = await axios.get(userUrl);
        console.log(users);
        dispatch(doLoadUsers(users));
      }
      fetchUsers()
    }, [])

    useEffect(() => {
      const fetchData = async () => {
        const { data: movies } = await axios.get(moviesUrl);
        console.log(movies);
        dispatch(doLoadMovies(movies));
      }
      fetchData()
    }, [])


  return (
    <div>
        <LoginComp/>
    </div>
  )
}

export default LoginPage
